const Form = () => {
  return (
    <div style={{ color: "green" }}>
      <form>
        <label>gmail</label>
        <input type="email">Gmail</input>

        <label>username</label>
        <input type="">Username</input>

        <label>password</label>
        <input type='Text'>Password</input>
      </form>
    </div>
  );
};

export default Form;
